import { config } from "../config.js";

export function docs() {
    let pl = 0;
    let fl = 0;
    const scrollplay = document.querySelector(".scrollplay");
    document.querySelectorAll('[data-hover]').forEach(dh => dh.addEventListener('mouseover',function() { dh.style.background = 'grey'; dh.style.color = 'white'; }))
    document.querySelectorAll('[data-hover]').forEach(dh => dh.addEventListener('mouseleave',function() { dh.style.background = 'none'; dh.style.color = 'black'; }))
    document.querySelectorAll('[data-play]').forEach(dp => dp.src = "data:image/png;base64,");
    document.querySelectorAll('[data-vol]').forEach(dv => dv.src = "data:image/png;base64,");
    document.querySelectorAll('[data-tdot]').forEach(dt => dt.src = "data:image/png;base64,");
    document.querySelectorAll('[data-full]').forEach(df => df.src = "data:image/png;base64,");
    document.querySelectorAll('[data-play]').forEach(dp => dp.addEventListener('click', function(e) {
        var videoe = dp.parentElement.parentElement.parentElement.parentElement.firstElementChild;
        var seeks = dp.nextElementSibling;
        var muteBtn = dp.nextSibling.nextSibling;
        seeks.max = videoe.duration;
        seeks.min = 0;
        if(pl == 0) {
            pl = 1;
            e.target.src = "data:image/png;base64,";
            if(videoe.paused) {
                videoe.play();
                var sint = setInterval(() => {
                    if(videoe.currentTime === videoe.duration) {
                        seeks.value = 0;
                        e.target.src = "data:image/png;base64,";
                        clearInterval(sint);
                    } else {
                        seeks.value = videoe.currentTime;
                        seeks.addEventListener('input',function(e) {
                            videoe.currentTime = e.target.value;
                        })
                    }
                });
            }
        } else {
            pl = 0;
            e.target.src = "data:image/png;base64,";
            videoe.pause();
        }
    }))
    document.querySelectorAll('[data-video]').forEach(dvid => {
        var vids = dvid.querySelector('[data-vds]');
        var seek = dvid.lastElementChild.lastElementChild.firstElementChild;
        seek.max = 'm';
    })
    document.querySelectorAll('[data-ctr]').forEach(davi => davi.addEventListener('mouseover',function(e) {
        var contrl = davi.firstElementChild;
        contrl.style.display = "flex";
    }))
    document.querySelectorAll('[data-ctr]').forEach(davi => davi.addEventListener('mouseleave',function(e) {
        var contrl = davi.firstElementChild;
        contrl.style.display = "none";
    }))
    document.querySelectorAll('[data-full]').forEach(df => df.addEventListener('click',function(e) {
        var dfpppp = df.parentElement.parentElement.parentElement.parentElement;
        if(pl == 0) {
            pl = 1;
            e.target.src = "data:image/png;base64,";
            dfpppp.requestFullscreen();
            df.textContent = "compress";
        } else {
            pl = 0;
            e.target.src = "data:image/png;base64,";
            dfpppp.removeFullscreen();
            df.textContent = "compress";
        }
    }))
    document.querySelectorAll('[data-vol]').forEach(dv => dv.addEventListener('click',function(e) {
        var dvpppp = dv.parentElement.parentElement.parentElement.parentElement.firstElementChild;
        var dvppppp = dv.parentElement.parentElement.parentElement.parentElement.parentElement.firstElementChild;
        if(dvpppp.muted == true && e.target.tagName == 'IMG') {
            e.target.src = "data:image/png;base64,";
            dvpppp.muted = false;
            e.target.nextElementSibling.nextElementSibling.firstElementChild.textContent = "mute";
        } else if(dvpppp.muted == false && e.target.tagName == 'IMG') {
            e.target.src = "data:image/png;base64,";
            dvpppp.muted = true;
            e.target.nextElementSibling.nextElementSibling.firstElementChild.textContent = "unmute";
        } else if(dvppppp.muted == true && e.target.tagName == 'LI') {
            dvppppp.muted = false;
            dv.textContent = "mute";
            e.target.parentElement.parentElement.children[2].src = "data:image/png;base64,";
        } else if(dvppppp.muted == false && e.target.tagName == 'LI') {
            dvppppp.muted = true;
            dv.textContent = "unmute";
            e.target.parentElement.parentElement.children[2].src = "data:image/png;base64,";
        }
    }))
    document.querySelectorAll('[data-tdot]').forEach(dtd => dtd.addEventListener('click', function() {
        var ns = dtd.nextElementSibling;
        if(ns.style.display == 'block') {
            ns.style.display = 'none';
        } else {
            ns.style.display = 'block';
        }
        ns.onclick = () => {
            ns.style.display = 'none';
        }
    }))
    
    document.querySelectorAll('[data-path]').forEach(dpt => dpt.addEventListener('click',function() {
        //
    }))
    
    config.css.forEach(ccs => {
        var mainStyle = document.createElement('link');
        mainStyle.rel = 'stylesheet';
        mainStyle.href = ccs;
        document.head.appendChild(mainStyle);
    })
    const siteTitle = document.createElement('title');
    siteTitle.textContent = config.title || 'server interface';
    document.head.appendChild(siteTitle);
    if(config.icon) {
        const siteIcon = document.createElement('link');
        siteIcon.rel = 'shortcut icon';
        siteIcon.href = config.icon;
        siteIcon.type = 'image/x-icon';
        document.head.appendChild(siteIcon);
    }

    const styles = document.querySelectorAll("style");
    styles.forEach(st => {
        const s = document.createElement("style");
        s.textContent = st.textContent;
        document.head.appendChild(s);
        st.remove();
    });

    const styleLinks = document.querySelectorAll("style[src]");
    styleLinks.forEach(st => {
        const link = document.createElement("link");
        link.rel = "stylesheet";
        link.href = st.getAttribute("src");
        document.head.appendChild(link);
        st.remove();
    });

    document.querySelectorAll('[data-switch]').forEach(a => a.addEventListener('click', function(e) {
        e.preventDefault();
        var chd = this.firstElementChild;
        if (this.style.cssText.includes('justify-content: left')) {
            this.style.cssText = "width: 60px;height: 30px;padding: 5px;border-radius: 40px;background: blue;display: flex;justify-content: right;align-items: center;";
            chd.style.background = "aqua";
        } else {
            this.style.cssText = "width: 60px;height: 30px;padding: 5px;border-radius: 40px;background: lightgrey;display: flex;justify-content: left;align-items: center;";
            chd.style.background = "white";
        }
    }));
}